#define AVE_DATA 400

int Breath( int data ) {

     static double average = 0  , rate = 0 ;
     static uint16_t aver_data[AVE_DATA] = {0};
     static uint16_t UPPER = 0 , LOWER = 0 , Max = 0 , Min = 0 ;
     static uint8_t up_down = 0 ;// flag  up=1 , down=0
     static uint8_t status = 0 ;
     static uint64_t time1 = 0 , time2 = 0 ;
     static int initial_count = 0 ;

     if ( flag.clear )
     {
          average = 0  ; rate = 0 ;
          memset( aver_data , 0 , sizeof(aver_data) );
          UPPER = 0 ; LOWER = 0 ; Max = 0 ; Min = 0 ;
          up_down = 0 ;// flag  up=1 , down=0
          status = 0 ;
          time1 = 0 ; time2 = 0 ;
          initial_count = 0 ;
     }


     else
     {

          if ( initial_count < AVE_DATA )
          {
               initial_count++ ;

               for ( int i = 0 ; i < AVE_DATA ; i++ )
               {
                    aver_data[i] = data ;
                    average += data ;// (float)AVE_DATA ;
               }

               if ( initial_count == AVE_DATA - 1 )
               {
                    average /= (float)AVE_DATA ;
                    Max = Min = average ;
                    // initial state
                    if ( data > average )
                         up_down = 1 ;
                    else
                         up_down = 0 ;
               }
          }

          else
          {

               // renew average
               //average -= aver_data[0] / (float)AVE_DATA ;
               average = 0 ;
               for ( int j = 0 ; j < AVE_DATA - 1 ; j++) {
                    aver_data[j] = aver_data[j + 1];
                    average += aver_data[j] ;
               }
               aver_data[AVE_DATA - 1] = data ;
               average += data ;

               average /= (float)AVE_DATA ;

               // down
               if ( up_down == 0 ) {
                    if ( data > (UPPER + average) ) { // change to up & add pulse
                         up_down = 1 ; // UP
                         Max = data ;
                    }
                    else if ( data < Min ) {
                         Min = data ;
                         LOWER = abs( average - Min ) / 3 ;
                    }
               }

               // up
               else if ( up_down == 1 )
               {
                    if ( data < (average - LOWER) ) { // change to down
                         up_down = 0 ; // down
                         Min = data ;
                         if ( status == 0 )
                              status = 1 ; // ignore first Max time
                         else if ( status == 1 )
                              status = 2 ; // save first Max time finish
                         else if ( status == 2 && (time2 - time1) > 0 ) {
                              int temp = (60 * 1000) / ((time2 - time1) * _SAMPLE_TIME) ;

                              if ( temp >= 5 && temp <= 30 ) {
                                   rate = temp ;
                                   status = 1 ;

                                   // time1 = time2 ;
                              }
                              // time1 = time2 ;
                         }
                    }
                    else if ( data > Max ) {
                         Max = data ;
                         UPPER = abs( Max - average ) / 3 ;
                         if ( status == 1 )
                         {
                              RTC_time = 0 ;
                              time1 = RTC_time ; // save  first Max time
                         }
                         else if ( status == 2 )
                         {
                              time2 = RTC_time ; // save second Max time
                         }
                    }
               }

               //sprintf( _string ,"\r\n\r\n%d,%d,%d,%d \r\n\r\n", data, (int16_t)average, (int16_t)(average - LOWER), (int16_t)(average + UPPER));

          }
     }
     return (int)rate;
}


void heart_rate_average( volatile uint16_t *temp  )
{
     static uint16_t buffer[ _SAMPLE ] = { 0 } ;
     static uint8_t x = 0 ;
     static uint16_t pre_heart = 0 ;
     float sum = 0 ;

     if ( flag.clear )
     {
          memset( buffer , 0 , sizeof( buffer) );
          x = 0 ; pre_heart = 0 ;
          *temp = 0 ;
     }

     else
     {

          if ( x < _SAMPLE ) {
               buffer[x] = *temp ;

               x++;

               for ( uint8_t i = 0 ; i < x ; i++)
                    sum += buffer[i] ;

               *temp = sum / x ;
               pre_heart = *temp ;
          }

          // else if ( abs( pre_heart - *temp ) > 20 )
          // {
          //      *temp = pre_heart ;
          // }

          else
          {
               for ( uint8_t i = 0 ; i < _SAMPLE - 1 ; i++) {
                    buffer[i] = buffer[i + 1] ;
                    sum += buffer[i] ;
               }

               buffer[ _SAMPLE - 1 ] = *temp ;
               sum += *temp ;

               *temp = sum / _SAMPLE ;
               pre_heart = *temp ;
          }
     }

}

